function TestComponent({ utilities, savedUserSettings, onSavedUserSettingsChange }) {
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    async function loadData() {
      const result = await utilities.rv.RunView({
        EntityName: 'Records'
        MaxRows: 100  // Missing comma
      });
      if (result.Success) {
        setData(result.Results || []);
      }
      setLoading(false);
    }
    loadData();
  }, []);

  if (loading) {
    return <div>Loading...</div>
  }

  return (
    <div>
      <h1>Records</h1>
      {data.map(item => (
        <div key={item.ID>
          {item.Name}
        </div>
      ))}
    </div>
  );
}
